import React from 'react';
import styled from 'styled-components';

import HeadSymbol from './head-symbol';

const BgWrapper = styled.div`
  background-image: linear-gradient(rgba(54, 0, 51, 1), rgba(11, 135, 147, 1)) !important;
`;
const Hack = () => (
  <BgWrapper>
    <HeadSymbol />
  </BgWrapper>
);

export default Hack;
